Description:
            We developed and patented a kit for home beer production using tools that we have in kitchens.
Under the brand "MOP - My Own Production beer" we started in April the production and marketing of kit ALE BEER 5L which is an easy and fun beer to prepare for a couple of hours with friends and will always be "my beer ".
The MOPbeer kit consists with a mixture of malt Pilsner and Munich fully open grain, hops (EUA & USA) 1,2,3 and 4, yeast, sanitizing and recipe ... everything else there are in kitchen’s home. The quantities available are necessary for the success of 5 liters or 1 Gal of home beer.
Beer features MOPbeer - Ale beer 5L kit:
Color - between golden light and dark amber;
Foam - good retention ranging from white and pearl;
Transparency - slightly cloudy;
Alcohol content - about 5.2%;
Palate - presented with a body ranging from a light to medium and moderate carbonation
